import React from "react";
import { useNavigate } from "react-router-dom";

import bg from "../assets/bg.jpg";

function Home(){

const navigate = useNavigate();

return(

<div>

{/* NAVBAR */}

<div style={styles.navbar}>

<h2 style={styles.logo}>OLA</h2>

<div>

<button style={styles.navBtn}>
Book an Ola Cab
</button>

<button style={styles.navBtn}>
Free S1 Test Ride
</button>

</div>

</div>



{/* HERO */}

<div style={styles.hero}>

<img src={bg} style={styles.bg}/>


<div style={styles.searchBox}>


<div style={styles.tabs}>

<span style={styles.activeTab}>
Daily
</span>

<span>
Rental
</span>

<span>
Outstation
</span>

</div>



<div style={styles.inputs}>

<input
placeholder="Current Location"
style={styles.input}
/>


<input
placeholder="Enter Location"
style={styles.input}
/>


<button
style={styles.searchBtn}
onClick={()=>navigate("/map")}
>

SEARCH OLA CABS â†’

</button>


</div>


</div>

</div>


</div>

);

}

export default Home;



const styles={

navbar:{

background:"black",
color:"white",
padding:"15px",
display:"flex",
justifyContent:"space-between"

},

logo:{

margin:0

},

navBtn:{

marginLeft:"10px",
padding:"10px",
border:"none"

},

hero:{

position:"relative"

},

bg:{

width:"100%",
height:"400px",
objectFit:"cover"

},

searchBox:{

position:"absolute",
top:"150px",
left:"50%",
transform:"translateX(-50%)",
background:"white",
padding:"20px",
width:"600px"

},

tabs:{

display:"flex",
gap:"20px",
marginBottom:"10px"

},

activeTab:{

borderBottom:"2px solid black"

},

inputs:{

display:"flex",
gap:"10px"

},

input:{

padding:"10px",
flex:1

},

searchBtn:{

background:"black",
color:"white",
padding:"10px"

}

}
